Пришла пора прекратить его муки. ]], 0.471000, 0.923000, 6, 867, 12292, 745, 1, 0, 6},
        {1563, "Принц Малчезар", [[ Неизвестно, каким образом Принц Малчезар, один из высших эредарских иерархов, попал в Каражан, но очевидно, чем он занимался в этом мрачном замке. Верхний этаж башни Каражана, где можно встретить Малчезара, окутан мраком - сама реальность начала изменятся, сливаясь с странным местом - Пустомарью. Возможно, Малчезар хотел превратить Каражан в свой форпост для дальнейшего вторжения его легиона в Азерот, возможно - его интересовали лишь мрачные тайны замка и природа его проклятия. В любом случае, демон должен быть уничтожен. ]], 0.514356, 0.309231, 17, 867, 12320, 745, 1, 0, 12},
        {11656, "Шахматы", [[ Чтобы запустить событие, нужно поговорить с Тенью Медива. По ходу партии игроки могут управлять разными шахматными фигурами, представляющими участников Первой войны в Азероте. Медив иногда играет не по правилам. Если рейд выигрывает партию, он может забрать добычу  после того, как Медив признает свое поражение. ]], 0.358000, 0.622000, 14, 867, 21159, 745, 1, 0, 11},
        {11002, "Ловчий Аттумен", [[ Ловчий Аттумен был известным на весь Альянс коневодом. Лошади слушались его так, как будто он говорил с ними на одном языке, а его скакуны за огромные деньги скупались знатью всех королевств. Какая нелегкая занесла ловчего с его конем под своды Каражана — мы не узнаем никогда, ибо проклятая башня рьяно хранит свои тайны, но что не подлежит сомнению, так это то, что Аттумен стал гораздо более кровожадным, чем был при жизни. ]], 0.452819, 0.826154, 18, 867, 12041, 745, 4, 0, 1},
        {11003, "Мороуз", [[ Мороуз был стариком, который жил в Каражане, служа кастеляном Медива. Он знал о видениях, показываемых магией замка, но стремился избегать их. Мороуз погиб от руки своего обезумевшего хозяина и попал под действие проклятья Каражана, которое будет вечно возрождать его в облике нежити. Он всё ещё пытается поддерживать порядок в замке и защищать его от непрошенных гостей. ]], 0.271280, 0.635385, 20, 867, 12060, 745, 4, 0, 2},
        {11004, "Благочестивая дева", [[ Создание титанов, воплощающее в себя чистоту и силу воли, Благочестивая дева прибыла в Каражан, будучи возмущенной пороками и злодеяниями тамошних обитателей. Однако проклятье этого таинственного замка поглотило и её. Теперь Благочестивая дева - такой же раб Каражана, вынужденная безнадежно искоренять пороки лишь затем, чтобы они явились вновь. ]], 0.834384, 0.500042, 21, 867, 12109, 745, 4, 0, 3},
        {11005, "Оперный зал", [[ Каражан - огромный замок, и что за замок без оперного зала? Барнс, конферансье Оперы, подобно другим жителям Каражана, застрял во времени, бесконечно повторяя свои представления. Но пока идет представление, через оперный зал не пройти. Быть может, стоит поучаствовать в постановке Барнса, чтобы пройти далее, в глубины Каражана?.. ]], 0.181023, 0.350770, 21, 867, 12123, 745, 4, 0, 4},
        {11006, "Смотритель", [[ Каражан огромен и полон ценностей, на которые наверняка с удовольствием наложили бы руку воры и авантюристы всех сортов. Чародейские стражи, могучие големы, переполненные магией, охраняют коридоры Каражана, и самые могучие из них - Смотрители - охраняет галерею, препятствуя дальнейшему исследованию этого проклятого замка. ]], 0.494869, 0.366155, 26, 867, 12177, 745, 4, 0, 6},
        {11007, "Тень Арана", [[ Эхо отца Медива, бледная тень некогда великого мага, бесцельно перемещается по библиотеке Каражана. Тень, утратившая последние капли рассудка в этой вечной пытке проклятого замка, но не утратившая ни капли могущества, легко примет любого незваного гостя Каражана за причину своих вечных страданий. ]], 0.716407, 0.260001, 27, 867, 12212, 745, 4, 0, 8},
    },
    [746] = {
        {11012, "Король Молгар", [[ Король Молгар и его чемпионы - самые могучие огры Запределья, являются гвардией Груула, охраняя Логово. Каждый из этих чемпионов обладает своими уникальными способностями, а их комбинированной силе можно противопоставить лишь стальную хватку Груула. ]], 0.550255, 0.570769, 2, 864, 11981, 746, 8, 0, 0},
        {11013, "Груул Драконобой", [[ Огромный гронн, прославившийся как Драконобой во время боя против Черной стаи Смертокрыла, который хотел спрятать яйца своей стаи в Острогорьи. Обитая в огромной пещере Логова Груула, он сам - жуткая угроза любому не-огру в Острогорье. ]], 0.249486, 0.283077, 2, 864, 11960, 746, 8, 0, 1},
        {1564, "Король Молгар", [[ Король Молгар и его чемпионы - самые могучие огры Запределья, являются гвардией Груула, охраняя Логово. Каждый из этих чемпионов обладает своими уникальными способностями, а их комбинированной силе можно противопоставить лишь стальную хватку Груула. ]], 0.550255, 0.570769, 1, 864, 11981, 746, 2, 0, 0},
        {1565, "Груул Драконобой", [[ Огромный гронн, прославившийся как Драконобой во время боя против Черной стаи Смертокрыла, который хотел спрятать яйца своей стаи в Острогорьи. Обитая в огромной пещере Логова Груула, он сам - жуткая угроза любому не-огру в Острогорье. ]], 0.199486, 0.283077, 1, 864, 11960, 746, 2, 0, 1},
    },
    [747] = {
        {11014, "Магтеридон", [[ Иллидан помог Акаме победить демонов и орков Магтеридона, и совместными усилиями они штурмовали Цитадель Адского Пламени. В итоге Магтеридон пал от руки Иллидана. По крайней мере, так считалось… Когда Иллидан сокрушил Магтеридона, последний был на пороге жизни и смерти, но, поняв это, Иллидан решил оставить Магтеридона в живых. Он приказал слугам спрятать тело Магтеридона в пещере, чтобы использовать его пылающую кровь для поддержания демонической силы орков. Слуги Иллидана ежедневно забирают большую часть крови демона, поэтому он находится в коме. Если Магтеридон когда-нибудь восстанет, то наверняка попытается вернуть себе Запределье… ]], 0.691795, 0.743077, 1, 865, 11919, 747, 8, 0, 0},
        {1566, "Магтеридон", [[ Иллидан помог Акаме победить демонов и орков Магтеридона, и совместными усилиями они штурмовали Цитадель Адского Пламени. В итоге Магтеридон пал от руки Иллидана. По крайней мере, так считалось… Когда Иллидан сокрушил Магтеридона, последний был на пороге жизни и смерти, но, поняв это, Иллидан решил оставить Магтеридона в живых. Он приказал слугам спрятать тело Магтеридона в пещере, чтобы использовать его пылающую кровь для поддержания демонической силы орков. Слуги Иллидана ежедневно забирают большую часть крови демона, поэтому он находится в коме. Если Магтеридон когда-нибудь восстанет, то наверняка попытается вернуть себе Запределье… ]], 0.691795, 0.743077, 1, 865, 11919, 747, 2, 0, 0},
    },
    [748] = {
        {1567, "Гидросс Нестабильный", [[ Огромный элементаль воды обитает в Змеином Святилище, очищаясь от скверны, которая поразила его, как и значительную часть элементалей Запределья, и помогая очиститься младшим элементалям. Но несмотря на все ухищрения наг, состояние Гидросса остается нестабильным, и стоит ему выйти из радиуса действия машин, построенных нагами, как яд вновь переполняет его. ]], 0.363590, 0.847692, 1, 862, 700, 748, 2, 0, 0},
        {1568, "Скрытень из глубин", [[ Удивительные существа населяют Запределье, и далеко не все из них обитают на поверхности. В самых глубинах Змеиного Святилища обитает причудливое создание, сродни кракенам, обитающим в северных морях Азерота - Скрытень из глубин. Того, кто потревожит странный водоем, место, где Скрытня подкармливают наги, ждет весьма.. необычная находка. ]], 0.402564, 0.581538, 1, 862, 711, 748, 2, 0, 1},
        {1569, "Леотерас Слепец", [[ Леотерас был одним из пяти эльфов крови, которых Иллидан взял к себе в ученики, дабы сделать из них охотников на демонов. Но путь охотника на демонов - не для слабых телом, и трое из пяти потеряли свои жизни. Слабого же духом Леотераса ждала гораздо более мрачная судьба. Пройдя через ритуал и обретя внутреннего демона, Леотерас не смог установить над ним контроль и обезумел. Чароплеты Змеиного Святилища удерживают его в заточении, пытаясь вернуть ему разум, но тщетно, ведь в голове Леотераса теперь всегда звучат два голоса - его и демона. ]], 0.417949, 0.255385, 1, 862, 722, 748, 2, 0, 2},
        {1570, "Повелитель глубин Каратресс", [[ Каратресс возглавляет личную стражу Леди Вайш. Опытный воин и жестокий командир, Каратресс избрал трех стражей, обладающих уникальными способностями. Вместе они являются последней линией обороны Змеиного Святилища и остаются непобежденными - ведь у Каратресса есть секрет, узнать который удается лишь перед смертью. ]], 0.504103, 0.176924, 1, 862, 738, 748, 2, 0, 3},
        {1571, "Морогрим Волноступ", [[ Морские гиганты, могучие, зловредные и, как правило, недалекие гуманоиды встречаются на забытых островах Азерота, и как правило, враждебны ко всему и вся. Морогрим Волноступ является исключением из этого правила. Неизвестно, как именно наги убедили его поселиться в Змеином Святилище, но этот гигант теперь обитает здесь, как и орда повинующихся ему мурлоков. ]], 0.596410, 0.260001, 1, 862, 769, 748, 2, 0, 4},
        {1572, "Леди Вайш", [[ Главная служанка Азшары, ставшая нагой, как и её госпожа, была отправлена, чтобы помочь Иллидану в его путешествии с целью уничтожить Ледяной Трон. И хотя её новый повелитель и не преуспел, Леди Вайш проследовала за ним в Запределье, где Иллидан и подвластные ему отряды начали спешно укреплять свои позиции в ожидании гнева Легиона. Могущественная морская ведьма управляет Змеиным святилищем и является страшным противником даже для самых опытных воинов. ]], 0.722563, 0.589231, 1, 862, 777, 748, 2, 0, 5},
        {11650, "Гидросс Нестабильный", [[ Огромный элементаль воды обитает в Змеином Святилище, очищаясь от скверны, которая поразила его, как и значительную часть элементалей Запределья, и помогая очиститься младшим элементалям. Но несмотря на все ухищрения наг, состояние Гидросса остается нестабильным, и стоит ему выйти из радиуса действия машин, построенных нагами, как яд вновь переполняет его. ]], 0.359000, 0.799000, 2, 862, 20930, 748, 8, 0, 0},
        {11651, "Горе\'лац", [[ Глубоко на дне водоема, в таинственных ответвлениях подземных пещер, слившись с камнем, обитает чудовищных размеров создание из шипов, яда и хитина, известное как Горе'лац. Древнейшее существо Зангартопи, чей разум далеко ушел от уровня примитивных созданий, населяющих водохранилище. Лишь изредка, поддавшись на лакомую добычу, гигантский краб покидает свое логово и всплывает на поверхность, чтобы утащить пищу в глубинные воды. Его появление пробуждает иные хищные создания подводного мира - но несколько доверенных надзирателей Леди Вайш следят за тем, чтобы Горе'лац не покидал глубины надолго.
Найдется ли умелый рыбак с удочкой достаточно крепкой, чтобы вытащить древнего краба из глубин? ]], 0.403000, 0.589000, 2, 862, 20998, 748, 8, 0, 1},
        {11652, "Леотерас Слепец", [[ Леотерас был одним из пяти эльфов крови, которых Иллидан взял к себе в ученики, дабы сделать из них охотников на демонов. Но путь охотника на демонов - не для слабых телом, и трое из пяти потеряли свои жизни. Слабого же духом Леотераса ждала гораздо более мрачная судьба. Пройдя через ритуал и обретя внутреннего демона, Леотерас не смог установить над ним контроль и обезумел. Чароплеты Змеиного Святилища удерживают его в заточении, пытаясь вернуть ему разум, но тщетно, ведь в голове Леотераса теперь всегда звучат два голоса - его и демона. ]], 0.417949, 0.255385, 2, 862, 20952, 748, 8, 0, 2},
        {11653, "Повелитель глубин Каратресс", [[ Каратресс возглавляет личную стражу Леди Вайш. Опытный воин и жестокий командир, Каратресс избрал трех стражей, обладающих уникальными способностями. Вместе они являются последней линией обороны Змеиного Святилища и остаются непобежденными - ведь у Каратресса есть секрет, узнать который удается лишь перед смертью. ]], 0.504103, 0.176924, 2, 862, 21019, 748, 8, 0, 3},
        {11654, "Морогрим Волноступ", [[ Морские гиганты, могучие, зловредные и, как правило, недалекие гуманоиды встречаются на забытых островах Азерота, и как правило, враждебны ко всему и вся. Морогрим Волноступ является исключением из этого правила. Неизвестно, как именно наги убедили его поселиться в Змеином Святилище, но этот гигант теперь обитает здесь, как и орда повинующихся ему мурлоков. ]], 0.596410, 0.260001, 2, 862, 21080, 748, 8, 0, 4},
        {11655, "Леди Вайш", [[ Главная служанка Азшары, ставшая нагой, как и её госпожа, была отправлена, чтобы помочь Иллидану в его путешествии с целью уничтожить Ледяной Трон. И хотя её новый повелитель и не преуспел, Леди Вайш проследовала за ним в Запределье, где Иллидан и подвластные ему отряды начали спешно укреплять свои позиции в ожидании гнева Легиона. Могущественная морская ведьма управляет Змеиным святилищем и является страшным противником даже для самых опытных воинов. ]], 0.722563, 0.589231, 2, 862, 21113, 748, 8, 0, 5},
    },
    [749] = {
        {1573, "Ал\'ар", [[ Феникс, путешествовавший вместе с Кель'тасом, его верный фамильяр, Ал'ар возрос в могуществе многократно с того дня, как они с Кель'тасом впервые увидели друг друга. Ныне он и его потомки служат своему повелителю, обитая в Крепости Бурь. ]], 0.501026, 0.587692, 1, 782, 806, 749, 2, 0, 0},
        {1574, "Страж Бездны", [[ Сквернобот, построенный подчиненными Кель'тасу демонами Пылающего Легиона и усовершенствованный механиками кровавых эльфов, использует огромную физическую силу и мощь тайной магии, чтобы охранять левое крыло Крепости Бурь. ]], 0.264075, 0.490686, 1, 782, 819, 749, 2, 0, 1},
        {1575, "Верховный звездочет Солариан", [[ Верховный звездочет обязан обладать острым умом, познаниями тайной магии, и умением смотреть в бездну, не теряя рассудка. Солариан идеально исполняет свою работу под руководством Кель'таса, и со временем к её способностям прибавились знания, полученные из Бездны. Стоит ли говорить о том, что эти знания будут задействованы в бою в случае необходимости? ]], 0.740000, 0.489230, 1, 782, 823, 749, 2, 0, 2},
        {1576, "Кель\'тас Солнечный Скиталец", [[ Правитель эльфов крови, последний принц этого народа, Кель'тас Солнечный Скиталец захватил Крепость Бурь и превратил её в свою твердыню с одной целью - заполучить контроль над хаотическими энергиями Пустоверти, обратив их в силу, которая сокрушит любого врага и поможет его народу утолить свою жажду магии. ]], 0.500999, 0.138461, 1, 782, 836, 749, 2, 0, 3},
        {11573, "Ал\'ар", [[ Феникс, путешествовавший вместе с Кель'тасом, его верный фамильяр, Ал'ар возрос в могуществе многократно с того дня, как они с Кель'тасом впервые увидели друг друга. Ныне он и его потомки служат своему повелителю, обитая в Крепости Бурь. ]], 0.501026, 0.587692, 1, 782, 1500, 749, 8, 0, 0},
        {11574, "Страж Бездны", [[ Сквернобот, построенный подчиненными Кель'тасу демонами Пылающего Легиона и усовершенствованный механиками кровавых эльфов, использует огромную физическую силу и мощь тайной магии, чтобы охранять левое крыло Крепости Бурь. ]], 0.264075, 0.490686, 1, 782, 1539, 749, 8, 0, 1},
        {11575, "Верховный звездочет Солариан", [[ Верховный звездочет обязан обладать острым умом, познаниями тайной магии и умением смотреть в бездну, не теряя рассудка. Солариан идеально исполняет свою работу под руководством Кель'таса, и со временем к её способностям прибавились знания, полученные из Бездны. Стоит ли говорить о том, что эти знания будут задействованы в бою в случае необходимости? ]], 0.740000, 0.489230, 1, 782, 1559, 749, 8, 0, 2},
        {11576, "Кель\'тас Солнечный Скиталец", [[ Правитель эльфов крови, последний принц этого народа, Кель'тас Солнечный Скиталец захватил Крепость Бурь и превратил её в свою твердыню с одной целью - заполучить контроль над хаотическими энергиями Пустоверти, обратив их в силу, которая сокрушит любого врага и поможет его народу утолить свою жажду магии. ]], 0.500999, 0.138461, 1, 782, 1604, 749, 8, 0, 3},
    },
    [753] = {
        {1597, "Аркавон Страж Камня", [[ Слабейший из стражей в Склепе, Аркавон Страж камня - огромный каменный гигант, управляющий силами земли. ]], 0.493350, 0.168738, 1, 532, 11475, 753, 3, 0, 0},
        {1598, "Эмалон Страж Бури", [[ Эмалон Страж Бури - великан, наделенный силами шторма. Он и его загробники охраняют Склеп Аркавона. ]], 0.627193, 0.553059, 1, 532, 11489, 753, 3, 0, 1},
        {1599, "Коралон Страж Огня", [[ Коралон Страж Огня - один из стражей Склепа Аркавона, могущественный каменный гигант, наделенный силами огня. ]], 0.363289, 0.551625, 1, 532, 11479, 753, 3, 0, 2},
        {1600, "Торавон Страж Льда", [[ Торавон Страж Льда - самый могущественный из стражей Склепа Аркавона, каменный гигант, наделенный силами льда. ]], 0.627151, 0.363767, 1, 532, 11484, 753, 3, 0, 3},
    },
    [754] = {
        {1601, "Ануб\'Рекан", [[ Ануб'Рекан - один из нерубианских лордов, служащий стражем Паучьего Квартала в Наксрамасе. ]], 0.306925, 0.469885, 2, 535, 11497, 754, 3, 0, 0},
        {1602, "Великая вдова Фарлина", [[ Некогда талантливый алхимик, ныне Фарлина - одна из высокопоставленых членов Культа Проклятых. Обитая в Паучьем квартале Наксрамаса, она обучает своих адептов темному мастерству. ]], 0.441725, 0.360899, 2, 535, 11504, 754, 3, 0, 1},
        {1603, "Мексна", [[ Гигантская паучиха, соткавшая свою паутину в одной из комнат Паучьего квартала Наксрамаса. Будучи объектом поклонения Фарлины и её культа, Мексна изо дня в день увеличивает число своего потомства, сохраняя свой яд таким же смертоносным, как и прежде. ]], 0.686466, 0.152964, 2, 535, 11511, 754, 3, 0, 2},
        {1604, "Нот Чумной", [[ Как Артас услышал зов Короля-лича, так и Нот в свое время присоединился к Плети в погоне за властью и могуществом. Во время Третьей войны, однако, Нот начал сомневаться в том, что он сделал, и Король-Лич, не долго думая, заморозил сердце в его груди. С тех пор Нот не знает не сомнений, ни пощады, и только смерть может остановить его. ]], 0.346122, 0.564531, 4, 535, 11518, 754, 3, 0, 3},
        {1605, "Хейган Нечестивый", [[ Хейган Нечестивый, один из числа некромантов, плотно занявшихся изучением и манипуляциями непосредственно с гибельной чумой, обитает в Наксрамасе, улучшая и развивая этот новый вид боевого колдовства. В его арсенале гибельные заклинания, ослабляющие проклятия, и наверняка есть еще пара тузов в рукаве. ]], 0.498172, 0.456978, 4, 535, 11525, 754, 3, 0, 4},
        {1606, "Лотхиб", [[ Споровые шаркуны - крайне интересный вид существ, порожденный болотами. Но Лотхиб - уникум даже среди них. Странные мутации привели к тому, что само его присутствие распространяет некротическую ауру, препятствующую любому исцелению. 
Не прошло много времени, прежде чем им заинтересовался Культ Проклятых, и теперь Лотхиб обитает в Квартале чумы, что в Наксрамасе. ]], 0.760165, 0.283523, 4, 535, 11530, 754, 3, 0, 5},
        {1607, "Инструктор Разувий", [[ Один из старших рыцарей смерти, оставшийся верный Королю-Личу даже после восстания рыцарей Черного Клинка. Теперь он обучает новое поколение рыцарей смерти в Военном квартале Наксрамаса. ]], 0.427469, 0.459909, 3, 535, 11537, 754, 3, 0, 6},
        {1608, "Готик Жнец", [[ Готик Жнец - эксперт в некромантии и темной магии, один из немногих некромантов, кто может поднять из мертвых не только тело, но и душу, превращая покойников в призрачных воителей. После восстания рыцарей Черного Клинка он находится в Военном квартале Наксрамаса, обучая неофитов искусству магии тьмы. ]], 0.675078, 0.596142, 3, 535, 11545, 754, 3, 0, 7},
        {1609, "Четыре Всадника", [[ Самые могущественные рыцари смерти в Наксрамасе - это четыре всадника. Они представляют собой вершину гвардии Кел'Тузада. Первый, Тан Корт'азз, обладает силой пламени. Следующая, леди Бломе, вызывает силу теней, вытягивая души живых в ненасытные объятия. Сэр Зелик, верный в жизни паладин, настолько сильный в своей вере, что даже в немощной силе света все еще прислушивается к его призыву, поражая своих врагов в битве. Последний рыцарь смерти, лорд Могрейн, был лучшим воином, которого когда-либо видели рыцари смерти. Однако после событий Азерота он бесследно исчез. Кел'Тузад назначил на его место Барона Ривендера. ]], 0.301273, 0.768225, 3, 535, 11606, 754, 3, 0, 8},
        {1610, "Лоскутик", [[ Лоскутик хочет поиграть!
Одно из самых монструозных поганищ, когда-либо созданных Плетью. Переживший мятеж рыцарей Черного Клинка, Лоскутик гордо именуется 'Воплощением войны'. Сейчас он сторожит коридоры Квартала мерзости, что в Наксрамасе. ]], 0.541192, 0.416887, 1, 535, 11622, 754, 3, 0, 9},
        {1611, "Гроббулус", [[ Один из несостоявшейся армии гигантов из плоти, Гроббулус обитает в Квартале мерзости, что в Наксрамасе. Жуткий монстр, созданный армией Плети. Плод извращенного ума гениальных инженеров и хирургов Плети. Огромный ходячий мутаген, который пропитан ядом, смертью, страхом и слизью... мерзкой слизью. ]], 0.615762, 0.531547, 1, 535, 11626, 754, 3, 0, 10},
        {1612, "Глут", [[ Огромный пес-нежить, поглощающий излишних зомби, обитает в Наксрамасе. Бесчисленные трупы, пожранные этим чудовищем, наделили его сверхъестественным нечестивым могуществом. Теперь он обитает в закрытой части Квартала мерзости, что в Наксрамасе, и единственный способ попасть туда - сточные трубы. ]], 0.462924, 0.438272, 1, 535, 11633, 754, 3, 0, 11},
        {1613, "Таддиус", [[ Чудовищный гигант из плоти, в котором запечатаны страдающие, агонизирующие души, зовущие на помощь даже сейчас, обитает в Квартале мерзости, что в Наксрамасе. Некромантия и эксперименты с электричеством обратили это чудовище к нежизни, и горе тому, кто схлестнется с монстром, способным испепелить врага вспышкой молнии. ]], 0.265857, 0.145792, 1, 535, 11639, 754, 3, 0, 12},
        {1614, "Сапфирон", [[ Некогда могущественный слуга Малигоса, хранитель артефактов, и не знающий поражений дракон из синей стаи, Сапфирон вступил в битву с Артасом во время его путешествия к Ледяному Трону, и проиграл. Артас пожертвовал значительной частью своих тогдашних сил, чтобы воскресить Сапфирона в виде могучего ледяного змея, и прорвался к Азжол-Нерубу с его помощью. Теперь, этот дракон охраняет палаты Кел'Тузада, находясь в логове ледяного змея, что в Верхнем некрополе Наксрамаса. ]], 0.565133, 0.675014, 6, 535, 11652, 754, 3, 0, 13},
        {1615, "Кел\'Тузад", [[ Кел'Тузад – один из главных служителей Короля-Лича, ответственный за распространение чумы Плети по Лордерону. После того, как был убит Артасом в эпоху Третьей Войны, переродился в образе лича. С помощью Артаса он призвал Архимонда Осквернителя, предводителя Пылающего Легиона. Тем не менее, Кел'Тузад был воистину предан Королю-Личу, а никак не Пылающему Легиону. Когда Артас отправился в Нордскол в период событий, связанных с Ледяным Троном, он оставил Кел'Тузада в качестве своего наместника для командования Плетью в Лордероне. Ранее он правил Чумными Землями из некрополя Наксрамас, парящим над Стратхольмом, но теперь Наксрамас и, соответственно, Кел'Тузад располагаются в восточной части Драконьего Погоста, где он вновь служит Королю-Личу. ]], 0.365324, 0.223293, 6, 535, 11660, 754, 3, 0, 14},
    },
    [755] = {
        {1616, "Сартарион", [[ Хранитель Обсидианового Святилища, чья задача - охранять кладку нового поколения стаи Смертокрыла. ]], 0.505736, 0.477055, 0, 531, 11419, 755, 3, 0, 0},
    },
    [756] = {
        {1617, "Малигос", [[ Малигос, Хранитель магии, обезумевший от горя и боли, начал войну против всех, кто использует магию, видя в чародеях лишь источник хаоса и бедствий. В Оке Вечности, что в Нексусе, он собирает энергию силовых линий Азерота, желая раз и навсегда покончить с угрозой чрезмерного использования магии. Ваша цель - остановить его. ]], 0.384321, 0.498566, 1, 527, 11449, 756, 3, 0, 0},
    },
    [757] = {
        {1618, "Чудовища Нордскола", [[  ]], 0.511514, 0.527373, 1, 543, 2450, 757, -1, 0, 0},
        {1619, "Лорд Джараксус", [[  ]], 0.463713, 0.405480, 1, 543, 11000, 757, -1, 0, 1},
        {1620, "Чемпионы Альянса", [[ Альянс требует справедливости, и бросает вызов вам, чемпионам Орды. Вашими противниками будут одни из самых лучших воинов Альянса, выступавших на этом турнире, но те, кто бросил вызов Орде, падут. Лок'тар огар! ]], 0.428340, 0.527373, 1, 543, 11059, 757, -1, 8, 2},
        {1621, "Чемпионы Орды", [[ Орда посмела обвинить Альянс в кознях, связанных с призывом эредарского лорда, и теперь требует справедливости, бросив вызов вам, чемпионам Альянса. Вашими противниками будут самые свирепые и умелые воины Орды, но они не чета вам, и должны быть уничтожены. Слава Альянсу! ]], 0.428340, 0.527373, 1, 543, 11201, 757, -1, 4, 2},
        {1622, "Валь\'киры-близнецы", [[  ]], 0.463713, 0.649266, 1, 543, 11016, 757, -1, 0, 3},
        {1623, "Ануб\'арак", [[  ]], 0.532546, 0.355289, 2, 543, 11038, 757, -1, 0, 4},
    },
    [758] = {
        {1624, "Лорд Ребрад", [[ Король-лич создал Ребрада из костей тысяч пропавших искателей приключений, и теперь он охраняет Ледяной Трон у подножья Шпиля, наполненный силой самого трона. ]], 0.391055, 0.593338, 1, 604, 11677, 758, -1, 0, 0},
        {1625, "Леди Смертный Шепот", [[ Леди Смертный Шепот окончательно заменила Кел'Тузада после падения Наксрамаса, став полноправным лидером Культа Проклятых. Находясь в Цитадели Ледяной Короны, она обучает самых одаренных и амбициозных из культистов, готовя из них новую магическую гвардию Плети. ]], 0.391055, 0.869980, 1, 604, 11683, 758, -1, 0, 1},
        {1626, "Битва на кораблях в Ледяной Короне", [[  ]], 0.219927, 0.550191, 2, 604, 0, 758, -1, 4, 2},
        {1627, "Битва на кораблях в Ледяной Короне", [[  ]], 0.690500, 0.550191, 2, 604, 0, 758, -1, 8, 2},
        {1628, "Саурфанг Смертоносный", [[ Храбрый и сильный орк, павший от руки Короля-Лича у Врат Гнева, был обращен в рыцаря смерти и теперь сторожит вход в внутреннее святилище Цитадели Ледяной Короны. Король-Лич наделил его особым могуществом - сила крови Саурфанга обладает невероятным исцеляющим эффектом, позволяя ему в одиночку сдерживать хоть армию, сражаясь до победы. ]], 0.515422, 0.216060, 0, 604, 11713, 758, -1, 0, 3},
        {1629, "Тухлопуз", [[ Одно из двух гигантских поганищ, созданных Мерзоцидом. Наделенный значительной физической силой и манипулирующий газом мерзкой гнили, Тухлопуз - опасное орудие Плети. ]], 0.198978, 0.654874, 0, 604, 11726, 758, -1, 0, 4},
        {1630, "Гниломорд", [[ Любимчик Мерзоцида. Поганище, источающее едкую, временами оживающую слизь, и обладающее значительной физической силой, Гниломорд - опасное орудие Плети. ]], 0.198978, 0.418259, 0, 604, 11733, 758, -1, 0, 5},
        {1631, "Профессор Мерзоцид", [[ Говорят, гениальность порой граничит с безумием. Профессор Мерзоцид - яркий пример этого случая. Безумный гений, создавший множество видов чумы, творец поганищ, лучший алхимик из когда-либо существоваших, Мерзоцид обитает в Чумодельне, что в Цитадели Ледяной Короны, и его изобретательности нет конца. ]], 0.131101, 0.532982, 0, 604, 11747, 758, -1, 0, 6},
        {1632, "Совет Кровавых принцев", [[ Валанар, Келесет и Талдарам - Сан'лейн, три принца крови, потерпевшие поражение от рук героев Азерота, бывшие кровавые эльфы, что заменили силу Солнечного колодца силой крови. Их тела были бережно сохранены и доставлены в Багровый зал Цитадели Ледяной Короны, где им суждено воскреснуть и продолжить свое вечное служение. ]], 0.520160, 0.141491, 0, 604, 11779, 758, -1, 0, 7},
        {1633, "Кровавая королева Лана\'тель", [[ Во время сражений на ледяных пустошах Нордскола Артас одержал победу над Иллиданом и Кель'тасом, а немногочисленные выжившие пытались скрыться от Плети. Но Король-Лич был намерен найти всех эльфов, осмелившихся бросить ему вызов. Тогда Лана'тель оказалась загнанной в угол и в отчаянии напала на Артаса, но не смогла противостоять Ледяной Скорби.

Король-Лич воскресил Лана'тель и сделал лидером Сан'лейн - эльфов крови, которые следили за успехом операцией Плети по всему северному материку. Сейчас Лана'тель находится в Багровом зале Цитадели Ледяной Короны, и её сила питает печать к телепорту на вершину Ледяного Трона. ]], 0.511599, 0.435467, 0, 604, 11792, 758, -1, 0, 8},
        {1634, "Валитрия Сноходица", [[ Одна из дочерей Изеры, могучая драконица, попавшая в плен к Плети. Находясь в плену в глубинах Залов Ледокрылых, что в Цитадели Ледяной Короны, Валитрия подвергается пыткам и явно не будет оставлена в живых, если возникнет риск её освобождения. Помогите ей, пока не стало слишком поздно! ]], 0.766814, 0.736678, 0, 604, 11808, 758, -1, 0, 9},
        {1635, "Синдрагоса", [[ Ощущая близящуюся смерть, ослепленная Синдрагоса отчаянно желала одного - добраться до Драконьего Погоста и встретить там свою смерть, как делали это до нее многие драконы. Однако сил дракона хватило не надолго. Обессиленная, она упала на землю ледника Ледяной Короны. Из последних сил, криком, полным отчаяния, Синдрагоса позвала своего супруга Малигоса. Холодные арктические ветра были единственными ее слушателями. Но она не сдалась и позвала еще раз. Расстояние было слишком велико. Осознав, что ее душа так и не обретет покой в Драконьем Погосте, она смирилась со своей участью. Жизнь постепенно уходила из нее, а разум затуманивался.

В бреду ее последние мысли были исполнены разочарования и ненависти: ненависти к Легиону, ненависти к Нелтариону, даже ненависти к Малигосу. Но больше всех она возненавидела мир смертных...

И перед смертью Синдрагоса поклялась отомстить.

Место, где встретил свою смерть могущественный дракон, стали называть Каньоном Гибели Синдрагосы.

Таким был жизненный путь Синего Дракона. Однако, как мы все знаем, на этом история не заканчивается. Спустя тысячи лет могущественный Король-Лич отыскал Синдрагосу и даровал ей возможность воплотить в жизнь свою смертельную клятву. Он сделал ее королевой Ледяных Драконов и поселил в Залах Ледокрылых. Сейчас Синдрагоса выполняет поручения Артаса. В Яме Сарона вы могли воочию убедиться в ее нынешнем могуществе. ]], 0.366325, 0.231898, 0, 604, 11829, 758, -1, 0, 10},
        {1636, "Король-лич", [[ После пробуждения Король-лич первым делом извлёк своё сердце, считая, что всё, что роднит со смертными, делает его слабее. Он отправился в Каньон Гибели Синдрагосы и воскресил древнего дракона Синдрагосу, которая была первой супругой Малигоса, в виде ледяного змея. После этого он наблюдал за своей гигантской армией нежити, готовой к войне. Во время сна своего правителя рыцарей смерти тренировали на территории Ледяной Короны. Пробудившись, он приказал им отправиться к Часовне Последней Надежды, где были похоронены тысячи героев Альянса, каждого из которых он желал воскресить на своей стороне, а затем захватить эти земли для Плети. Сейчас он восседает на Ледяном Троне, что в Цитадели Ледяной Короны, и только его смерть может остановить военную машину Плети от уничтожения всего живого. ]], 0.499296, 0.528743, 0, 604, 11855, 758, -1, 0, 11},
        {1637, "Леди Джайна Праудмур", [[ На вершине Цитадели Ледяной Короны, за мгновение до того, как Король-лич получил смертельный удар, история этого мира изменилась. Леди Джайна Праудмур отринула голос рассудка и встала на защиту того, кого некогда так любила. Судьба Артаса теперь зависит от того, смогут ли герои Азерота сразить не воплощение зла, но оступившегося товарища. ]], 0.499296, 0.568743, 0, 604, 900, 758, 8, 0, 12},
    },
    [760] = {
        {1651, "Ониксия", [[ На краю Пыльных топей стоит пещера, ставшая последним пристанищем для проклятого рода Черных Драконов. Логово Ониксии - имя этому пристанищу, и число черных драконов медленно, но верно растет с каждым днем. Этой угрозой нельзя пренебречь. ]], 0.672370, 0.309886, 0, 718, 11400, 760, 3, 0, 0},
    },
    [761] = {
        {1652, "Халион", [[  ]], 0.491354, 0.535788, 0, 609, 1000, 761, -1, 0, 0},
    },
    [762] = {
        {11585, "Огглфлинт", [[ Огглфлинт и трогги некогда безраздельно правили в глубинах Огненной пропасти, пока туда не подошли культисты Пламенеющего Клинка. Слишком слабые, чтобы прогнать Пламенеющий Клинок, Огглфлинт и трогги отступили на верхние уровни Пропасти Яростного Пламени, где теперь терпеливо ждут своего нежеланного гостя. ]], 0.566000, 0.385000, 0, 680, 20001, 762, -1, 0, 1},
        {11586, "Тарагаман Ненасытный", [[ Считается, что он является лидером Пламенеющего Клинка, он прячется в огненных глубинах Огненной Пропасти, используя свое демоническое влияние, чтобы развратить граждан Оргриммара. На самом деле лидеры Пламенеющего Клинка - Баззалан и Жергош, этот страж Скверны - расходная приманка, чтобы заманить молодых авантюристов Орды на смерть. ]], 0.410000, 0.574000, 0, 680, 20002, 762, -1, 0, 2},
        {11587, "Баззалан", [[ Баззалан возглавляет культистов Пламенеющего Клинка вместе с Джергошем Призывателем. Его мотивы не ясны, но, как и все сатиры, он быстрый и хитрый противник.  ]], 0.420000, 0.861000, 0, 680, 20004, 762, -1, 0, 3},
        {11588, "Жергош Призыватель Духов", [[ Жергош Призыватель отверг идеалы орков и практикует темные и демонические искусства чернокнижника. Лидер культистов Тлеющего Клинка, Жергош обитает в Огненной Пропасти, выдумывая план, достаточно опасный, чтобы привлечь внимание самого Тралла. Он охраняет заполненную кровью сферу, которая необходима для вызова опаснейших демонов. ]], 0.343000, 0.817000, 0, 680, 20006, 762, -1, 0, 7},
    },
    [763] = {
        {11589, "Дознаватель Вишас", [[ Джеймс Вишас является крестоносцем Алого ордена и ведущим следователем ордена. Он любит пытать любую захваченную нежить и гордится своей работой. Вишас известен своим неумолимым садизмом, жестоким опытом и высоким голосом. Следователь Вишас неделями мучил Воррела Сенгутца. Вишас взял обручальное кольцо Сенгутца и подарил его собственной жене Нэнси Вишас. Нэнси живет с дедушкой Вишасом, который предположительно является отцом Джеймса, хотя об этом не упоминается, в коттедже на восточном берегу озера Лордамер в Альтеракских горах. ]], 0.719000, 0.594000, 0, 889, 20272, 763, -1, 0, 1},
        {11590, "Железноспин", [[ Железный Шпин - это элитный редкий скелет моба 31 уровня, который обитает на кладбище Монастыря Алого ордена. Долговязые и кажущиеся хрупкими скелеты обладают сверхчеловеческой силой и обладают высокой устойчивостью к большинству физических атак. ]], 0.517000, 0.675000, 0, 889, 20274, 763, -1, 0, 1},
        {11591, "Павший воитель", [[ Когда-то святой паладин Монастыря Алого ордена, Павший воитель был чемпионом Алого ордена, позже убитым, а затем поднятым в качестве слуги Короля Мертвых. Он бродит по кладбищу, все еще владея доспехами и оружием, которое он использовал при жизни, но поскольку нежить не может использовать силы Святого Света, он превратился в воина. ]], 0.355000, 0.664000, 0, 889, 20276, 763, -1, 0, 1},
        {11592, "Волшебник крови Талнос", [[ Маг крови Талнос-мини-босс элитных скелетов,однажды найденный на кладбище Монастыря Алого ордена,прямо под лестницей в дальнем конце самого кладбища. ]], 0.243000, 0.560000, 0, 889, 20278, 763, -1, 0, 1},
    },
    [764] = {
        {11593, "Верховный инквизитор Фэйрбанкс", [[ Фэрбенкс являлся доверенным советником верховного лорда Могрейна и присутствовал на встрече в Южнобережье, которая привела к созданию Испепелителя.

Фэрбенкс с Верховным лордом Могрейном были обмануты его сыном Рено в Стратхольме, где их ждали легионы Плети. Фэрбенкс упал первым, но не умер, оказавшись в ловушке, спрятанным под трупами нежити. Он был безмолвным свидетелем предательства Рено, слыша мучительные крики Могрейна, когда Испепелитель пронзил его сердце и задел лезвие. Кел'Тузад позже воскресил Могрейна как рыцаря смерти.

Возвращаясь в Монастырь Алого ордена, Фэрбенкс рассказал историю о предательстве всем, кто готов был ее слушать. Те, кто верил ему, покинули крестовый поход, чтобы основать Серебряный Рассвет. Впоследствии Фэрбенкс был убит оставшимися крестоносцами за богохульство и, возможно, проявление симптомов чумы. Его тело было выброшено в секретную комнату Собора Алого ордена. ]], 0.553000, 0.256000, 0, 940, 20282, 764, -1, 0, 1},
        {11594, "Командир Алого ордена Моргрейн", [[ Командир Алого ордена Могрейн - молодой командир вооруженных сил Алого Крестового Похода в Монастыре Алого ордена. Он элитный босс - паладин 40 уровня, находящийся в Часовне Крестоносцев в Соборе Монастыря Алого ордена. ]], 0.492000, 0.271000, 0, 940, 20288, 764, -1, 0, 1},
        {11595, "Верховный инквизитор Вайтмейн", [[ Салли Вайтмейн - жрица света и Верховный Инквизитор из Алого ордена. Она руководит их деятельностью из собора Монастыря Алого ордена. В юном возрасте Салли стала свидетелем того, как ее семья погибла от ужасающей чумы нежити. С того дня страшная жрица нашла удовлетворение и удовольствие только в одном: в очищении и уничтожении нежити. ]], 0.490000, 0.168000, 0, 940, 20292, 764, -1, 0, 1},
    },
    [765] = {
        {11596, "Псарь Локси", [[ Гончар Локси - один из четырех лидеров Монастыря Алого ордена и капитан, отвечающий за обучение гончих, которых Алый Крестовый поход использует для выслеживания своих врагов. Локси командует устрашающими собаками, которые могут разорвать свою жертву на части за считанные минуты. ]], 0.293000, 0.837000, 0, 938, 20298, 765, -1, 0, 1},
        {11597, "Чародей Доан", [[ Он хранитель библиотеки монастыря, хранитель тайны, которой, по слухам, не доверяет Алый крестовый поход. Тем не менее, он действительно является доверенным лицом Крестового Похода, хранящим жизненно важный ключ, открывающий доступ к операциям Алого ордена в Чумных землях. Чародей Доан считает, что тайная магия - единственный способ избавить Лордерон от Плети. ]], 0.833000, 0.742000, 0, 938, 20300, 765, -1, 0, 1},
    },
    [766] = {
        {11598, "Ирод", [[ В распоряжении Алого ордена великое множество инструментов для борьбы с нежитью. Послушников сперва нужно научить обращаться с клинками и молотами, стрелами и щитами. Всю жизнь Ирод посвятил искусству сражения этими разрушительными орудиями, и охотно готов продемонстрировать нечестивым врагам ордена свое мастерство. ]], 0.786000, 0.104000, 0, 939, 20305, 766, -1, 0, 1},
    },
    [767] = {
        {11599, "Киртонос Глашатай", [[ Он давно стал мастером Некроситета. Ответственный за многие злодеяния во время правления Крастинова над Некроситетом, Киртонос питался кровью своих невинных жертв. Чтобы умилостивить своего хозяина, доктору Крастинову приходилось снабжать горгулью все большим количеством крови. ]], 0.497000, 0.101000, 2, 890, 20309, 767, -1, 0, 0},
        {11600, "Джандис Барова", [[ Джандис Барова являются человек призраком мини-босс находится в Некроситете в секретной комнате. Она является членом злополучной семьи Баровых. Они были чрезвычайно богатой семьей в Лордероне, владеющие землей, которая включала Каэр Дарроу и многие другие. ]], 0.541000, 0.144000, 3, 890, 20317, 767, -1, 0, 1},
        {11601, "Громоклин", [[ Громоклин - босс костяной голем в Некроситете. После того, как потерпел поражение от Альянса во время битвы за Андорал, он воссоздан из костей внутри Некроситета в главном склепе.  ]], 0.321000, 0.650000, 3, 890, 20319, 767, -1, 0, 2},
        {11602, "Рас Ледяной Шепот", [[ Рас Ледяной Шепот лич из Плети и надзиратель всего того, что произошло в Некроситете. Он наблюдал и учил всех, кто поднялся до положения Темного Мастера. Он был лейтенантом и любимым учеником Кел'Тузада. Рас Ледяной Шепот когда-то был человеком- магом из Стромгарда . Он был магом-изгородью , волшебником-мошенником, который так и не получил формального обучения в Даларане. ]], 0.405000, 0.815000, 4, 890, 20322, 767, -1, 0, 5},
        {11603, "Доктор Теолен Крастинов", [[ Известный как «Мясник», Крастинов был слугой Киртоноса Глашатая и главным мучителем и поставщиком тел и частей тела для экспериментов в Некроситете по некромантии. Его первые жертвы были завербованы из семьи Каэр Дарроу. ]], 0.888000, 0.462000, 3, 890, 20328, 767, -1, 0, 7},
        {11604, "Мардук Блэкпул", [[ Мардук Блэкпул, также известный как Мардук Черный, был печально известным рыцарем смерти от Плети. Он был, пожалуй, наиболее известен своим участием в битве при Дарроушире во время Третьей войны , где он закрепил поражение людей, развращая дух Джозефа Редпата. Некоторое время спустя Мардук удалился в Некроситет. ]], 0.442000, 0.644000, 2, 890, 20331, 767, -1, 0, 3},
        {11605, "Вектус", [[ Вектус является скелетом магом мини-боссом и один из главных учителей некромантии из Некроситета. Вектус развил измученную стаю драконов, обитающую в Некроситете, которую он получил, заплатив деньги Тинки Стимбоил в Пылающих степях за яйца из пика Черной горы. ]], 0.486000, 0.658000, 2, 890, 20335, 767, -1, 0, 4},
        {11606, "Хранитель знаний Полкелт", [[ Полкелт - один из шести мини-боссов, необходимых для вызова Гандлинга. Как мы можем судить по его имени, когда-то он был хранителем знаний, знаний, которые, к сожалению, были утеряны, поскольку теперь он неуклюжий, неразумный монстр. ]], 0.723000, 0.220000, 3, 890, 20339, 767, -1, 0, 8},
        {11607, "Инструктор Коварнесса", [[ Инструктор Коварнесса- высший эльф-инструктор,обучающая культистов в Некроситете. ]], 0.726000, 0.700000, 3, 890, 20343, 767, -1, 0, 6},
        {11608, "Леди Иллюсия Барова", [[ Леди Иллюсия Барова призрак мини-босс находится в Некроситете. Она была женой лорда Алексея Барова и одной из шести мини-боссов, которых нужно убить, чтобы призвать мастера тьмы Гандлинга. ]], 0.675000, 0.141000, 4, 890, 20348, 767, -1, 0, 11},
        {11609, "Лорд Алексей Баров", [[ Лорд Алексей Баров был лордом Каэр Дарроу, Брилл, Таррен Милл и Южнобережья. Он был отцом Алекси, Уэлдона и Джандис Баровой и мужем Леди Иллюсии Баровой. Подобно Джендис и Иллусии, он теперь агент Плети из Некроситета. Алексей Баров - один из шести боссов, которых нужно победить, чтобы призвать мастера тьмы Гандлинга. Он также охраняет документы на Каэр Дарроу. ]], 0.791000, 0.300000, 4, 890, 20353, 767, -1, 0, 10},
        {11610, "Равениан", [[ Равениан - необычный вид нежити. Неизвестно, как произошло это преобразование. Есть слух, что Равениан пожирает учеников Некроситета, которые не проявляют прилежания в учебе. Кроме того, Равениан является одним из шести боссов , которые должны быть побеждены, чтобы вызвать Темного магистра Гандлинга. ]], 0.673000, 0.477000, 4, 890, 20356, 767, -1, 0, 9},
        {11611, "Темный магистр Гендлинг", [[ Мастер Тьмы Гэндлинг - последний босс в Некроситете. Его учителем некромантии был Рас Ледяной Шепот. Гэндлинг является директором Школы некромантии в Каэр Дарроу, назначенным лично Кел'Тузадом. ]], 0.681000, 0.302000, 4, 890, 20360, 767, -1, 0, 12},
    },
    [771] = {
        {11623, "\"Огненный Левиафан\"", [[ Вход во внутренний двор Ульдуара охраняет огромный бронированный танк. Хранитель Мимирон построил "Огненный Левиафан" как часть оружейной платформы "В-0-7 ТР0Н". ]], 0.491000, 0.389000, 1, 529, 20484, 771, -1, 0, 0},
        {11624, "Повелитель горнов Игнис", [[ Как и другие творения титанов в Ульдуаре, Игнис теперь подчиняется воле древнего бога Йогг-Сарона. Этот внушительный огненный гигант обитает в Гигантской кузне и создает армии железных воинов, которые должны покорить Азерот, во имя Йогг-Сарона. ]], 0.383000, 0.266000, 1, 529, 20534, 771, -1, 0, 1},
        {11625, "Острокрылая", [[ Веранус, мать стаи протодраконов Грозовой гряды, служила хранителю Ториму, пока Локен не пленил ее, превратив в грозное оружие. Повелитель горнов Игнис укрепил драконью чешую железными пластинами, сделав Острокрылую еще смертоноснее. ]], 0.541000, 0.268000, 1, 529, 20545, 771, -1, 0, 2},
        {11626, "Разрушитель ХТ-002", [[ Мимирон спроектировал этот автономный механизм для охраны мусорной свалки Ульдуара и наделил его зачатками интеллекта, необходимыми для выполнения нехитрых обязанностей. ХТ-002 считает себя сыном хранителя и, как и положено капризному ребенку, иногда впадает в истерику. ]], 0.485000, 0.145000, 1, 529, 20566, 771, -1, 0, 3},
        {11627, "Железное Собрание", [[ Во главе железных легионов Локена стоят три суровых генерала, каждый из которых представляет одну из созданных титанами рас. Буревестник Брундир, мастер рун Молгейм и гигант Сталелом служат тому, кто на самом деле повелевает хранителем, - зловещему Йогг-Сарону. ]], 0.154000, 0.568000, 2, 529, 20587, 771, -1, 0, 4},
        {11628, "Кологарн", [[ Локен приказал повелителю горнов Игнису выковать этого великана для защиты Обвалившейся галереи. Своими огромными руками Кологарн способен раздавить любого, кто попытается проникнуть во внутреннее святилище Ульдуара. ]], 0.373000, 0.126000, 2, 529, 20607, 771, -1, 0, 5},
        {11629, "Ауриайя", [[ Архивариус Ульдуара блуждает по Кругу Наблюдения в компании диких кошек. Долгие годы, проведенные в одиночестве, сломили Ауриайю, а возрастающее влияние Древнего бога окончательно лишило ее рассудка. ]], 0.511000, 0.569000, 3, 529, 20619, 771, -1, 0, 6},
        {11630, "Ходир", [[ Ходир когда-то главенствовал в Храме Зимы, повелевая снежными великанами Грозовой гряды. Теперь этот хранитель обитает в ледяной пещере в Залах Зимы, и разум его подчинен воле Йогг-Сарона. ]], 0.667000, 0.637000, 3, 529, 20632, 771, -1, 0, 7},
        {11631, "Торим", [[ Годами Торим верил, что великаны убили его любимую жену Сиф. Обрушив гнев на своих союзников, он впал в отчаяние. Когда Торим узнал, что за преступлением стоит его брат Локен, тот заключил хранителя в Ульдуаре, где Древний бог помутил его разум. ]], 0.718000, 0.484000, 3, 529, 20656, 771, -1, 0, 8},
        {11632, "Фрейя", [[ Хранительница Фрейя была защитницей всего живого, а помогали ей в этом трое верных старейшин. И хотя ее оранжерею до сих пор убивает буйная зелень, рассудок ее не устоял перед шепотом Древнего бога. ]], 0.533000, 0.230000, 3, 529, 20711, 771, -1, 0, 9},
        {11633, "Мимирон", [[ Будучи блестящим изобретателем, Мимирон на протяжении всей истории Азерота сконструировал множество механизмов, которые до сих пор вызывают трепет и восхищение. Но попав под влияние Локена, этот хранитель Ульдуара начал создавать только машины войны. ]], 0.436000, 0.414000, 5, 529, 20752, 771, -1, 0, 10},
        {11634, "Генерал Везакс", [[ Странные существа, именуемые безликими, обитают в глубинах Ульдуара. Один из повелителей генерал Везакс, охраняет извилистые коридоры, ведущие в темницу Йогг-Сарона. ]], 0.569000, 0.605000, 4, 529, 20793, 771, -1, 0, 11},
        {11635, "Йогг-Сарон", [[ Сон наяву, Чудовище из ваших кошмаров, Демон с тысячью лиц.
Все должны склониться перед волей господина. Ваши жалкие потуги лишь делают его сильнее... ]], 0.681000, 0.401000, 4, 529, 20805, 771, -1, 0, 12},
        {11636, "Алгалон Наблюдатель", [[ После смерти Локена Пантеону было отправлено предупреждение о том, что Азерот лишился Главного куратора. Вскоре на Азерот прибыл Алгалон Наблюдатель, чьей задачей было выявление признаков поражения планеты порчей. В случае необходимости констеллар запустит алгоритм пересоздания мира, вследствие чего все его обитатели погибнут. ]], 0.788000, 0.466000, 2, 529, 20863, 771, -1, 0, 13},
    },
    [773] = {
        {11657, "Импорус", [[ Первый из гвардии Мурозонда, могучий воин, яростно сражающийся в ближнем бою и использующий разрушительную магию времени, обращая своих противников в прах ]], 0.661000, 0.648000, 0, 924, 21202, 773, 10, 0, 1},
        {11658, "Исказитель времени Элонус", [[ Величайший из хрономантов Мурозонда, назначенный им служить одним из двух стражей пути за пределы времени. Могущественный заклинатель, не преследующий противников, предпочитая обстреливать их заклинаниями пока они сами не вступят в ближний бой. ]], 0.718000, 0.848000, 0, 924, 21215, 773, 10, 0, 2},
        {11659, "Мурозонд", [[ В каждой душе есть место тьме и безумию. Сознание некогда благородного и верного своему долгу Ноздорму подточило видение его собственной смерти, дарованное ему Аман'Тулом. Теперь он - Мурозонд, повелитель драконов Бесконечности, пошедший против судьбы и стремящийся выжить любой ценой - даже если это будет означать приход Конца Времени и конец мира, как мы его знаем.
Здесь, в этой гибнущей временной линии его труды явно принесли свои плоды - и ему остается лишь последний шаг - стереть эту временную линию.. и приняться за следующую. ]], 0.376000, 0.249000, 0, 924, 21238, 773, 10, 0, 3},
    },
    [774] = {
        {11660, "Гогонаш", [[ Не сумев удержать огромного властителя преисподней Аргалота в темнице величественной Аметистовой крепости Даларана, маги Кирин-Тора были вынуждены заключить могущественного демона в одной и самых крепких темниц - в глубинах Тол'Гарода. К сожалению или к счастью, стража не могла долго сопротивляться жгучей ненависти, исходящей от демона и в попытках окончить его существование, демон освободился. ]], 0.802000, 0.627000, 0, 954, 21288, 774, 3, 0, 0},
        {11661, "Поглотитель разума Ктракс", [[ Это жуткое существо было поймано в глубинах Ульдуара. Его пленили, когда оно впало в оцепенение после поражения Йогг-Сарона. Опасаясь его силы, маги Кирин-Тора решили отправить его в максимально защищенное место - в темницу Тол'Гарода, однако со временем, чудовище по загадочной причине пробудилось, и теперь мощные системы безопасности Тол'Гарода не могут сдержать его.  ]], 0.478000, 0.175000, 0, 954, 21298, 774, 3, 0, 1},
        {11662, "Пожиратель магии", [[ Перевезенный еще будучи маленьким "щенком", пожиратель медленно, но верно рос в глубинах Тол'Гарода, до тех пор, пока по соседству не заселились представители магии Тьмы и Скверны. Излучаемая ими магия небольшими крупицами впитывалась в еще не окрепшее тело пожирателя, изменяя и преображая его сущность. ]], 0.162000, 0.631000, 0, 954, 21322, 774, 3, 0, 2},
    },
    [777] = {
        {11672, "Норигорн", [[ Много крови было пролито в противостоянии Альянса, Орды и Ренегатов за ресурсы и сокровища острова Тол'Гарод. Капля по капле, кровь достигла силовой линии, что в самом сердце острова, под землей - и кровь нашла отклик. Со скрежетом врата тюрьмы открылись, и открывшийся путь зовет искателей сокровищ из всех фракций. Осталась лишь одна преграда - пробужденный зовом крови Страж силовых линий, Норигорн. ]], 0.162000, 0.631000, 0, 0, 21530, 777, 1, 0, 0},
    }
}
