    [21084] = {21084, "Уничтоженная броня", [[ Монументальный удар сокрушил вашу броню, нанеся ей невосстановимый ущерб. Показатель брони снижен на 4%. ]], 0, 0, 310138, 11654, 0, 0, 0, 1, 1, 2, 2, -1, 0},
