    [21086] = {21086, "Крушащий топот", [[ Морской великан сотрясает землю, нанося 16000 физического урона противникам в радиусе 10 м., а также 10000 урона от магии льда всем противникам на расстоянии, превышающем 10 м., раз в 1 сек. в течение 3 сек. ]], 0, 0, 310140, 11654, 21087, 0, 0, 1, 4, 2, 2, -1, 0},
