    [21088] = {21088, "Запах крови", [[ Вы пережили "Хватку великана", но кровь из ваших ран привлекает 6 "Глубоководных мурлоков", которые видят вас и будут атаковать в течение 2 мин. ]], 0, 0, 310145, 11654, 0, 0, 0, 1, 32, 2, 2, -1, 0},
